$_MODULE['<{performancepro}prestashop>databaseanalyticsform_9f09dbec13b06bace520c0cfe8747ab2'] = 'Analitika e bazës së të dhënave';
$_MODULE['<{performancepro}prestashop>databaseanalyticsform_53927219d5856a36e7b351f5ce409dc5'] = 'Këtu janë disa këshilla të avancuara për konfigurimin e bazës së të dhënave tua për performancë më të mirë. Këto cilësime rekomandohen për shumicën e faqeve të internetit të PrestaShop. %s. Duke klikuar \"Optimizo vlerën\", ti përditëson vlerën në vlerën e rekomanduar. Kjo vlerë ruhet derisa baza e të dhënave të riniset. Nëse dëshiron t\'i ndryshosh në vlerë të përhershme, duhet ta bësh në %s. Vendndodhja e skedarit të konfigurimit të bazës së të dhënave varet nga konfigurimi i serverit tënd të internetit.';
