$_MODULE['<{performancepro}prestashop>dashboardform_34bc6a7ec06ed482766acee064954566'] = 'Pastrimi i të dhënave të vjetruara është një mënyrë e shkëlqyer për të përmirësuar shpejtësinë e aplikacionit tënd. Moduli ofron disa mjete të shkëlqyera në lidhje me këtë proces pastrimi! Mund ta ekzekutosh veprimin nga butoni ose ta bësh atë nga një kërkesë GET nga një punë kronometrike.';
$_MODULE['<{performancepro}prestashop>dashboardform_b816eba2d26e0b6240a9549abb8d9833'] = 'Nuk këshillohet ta pastrosh rregullisht \'cache\'-n. Në vend të kësaj, \'cache\'-i duhet të hiqet nëse ka një arsye të mirë, përndryshe çdo gjashtë muaj. Kjo është për shkak se \'cache\'-i  e mban faqen tënde të shpejtë. Duhet të rindërtohet sa herë që pastron memorien kesh, gjë që kërkon kohë. Nëse ke një shërbim ku i sinkronizon automatikisht produktet nëpërmjet një API, mund të mendosh t\'i integroni disa nga këto pika fundore në tubacionin tënd.';
$_MODULE['<{performancepro}prestashop>dashboardform_8072096e0d68b9949581113c2d0286dd'] = 'Për ato veçori që nuk kanë të bëjnë me pastrimin e \'cache\'-it, mund të mendosh të vendosësh disa punë kronometrike. Intervali varet nga shumë faktorë, por çdo 14-30 ditë është i përshtatshëm për shumicën.';
$_MODULE['<{performancepro}prestashop>dashboardform_d0b36894112d39b7396cb88cf31e54a8'] = 'Këto mjete bëjnë ndryshime në sistemin tënd të cilat nuk mund të zhbëhen. Prandaj, rekomandohet ta kopjosh bazën e të dhënave dhe sistemin e skedarëve për arsye sigurie. Për të shmangur problemet me pastrimin \'Smarty Cache\' dhe SF \'cache\', prit derisa të kryhet përpara se të bësh ndonjë gjë tjetër në aplikacionin tënd.';
$_MODULE['<{performancepro}prestashop>dashboardform_112fd31c936f6803c00f50e388c5103c'] = 'Disa nga komandat do të marrin pak kohë për t\'u ekzekutuar. Prandaj, rekomandohet t\'i ekzekutosh një nga një. Sidomos ngrohësit të \'cache\'-it i nevojitet më shumë kohë.';
