$_MODULE['<{performancepro}prestashop>imageoptimizationform_d466c69d068fccfaf6a65f26de006427'] = 'Sigurohu që imazhet tua të mos jenë më të mëdha se sa duhet, se ato janë në formatet e imazheve të gjeneratës së ardhshme dhe se ato janë të ngjeshura për ueb. Asnjë nga imazhet tua nuk do të anashkalohet; moduli do të krijojë një version të optimizuar të imazhit tënf në një dosje të \'cache\'-it dhe do ta shërbejë këtë imazh për përdoruesit e tu në vend të origjinalit. Përsëri, kjo bëhet në fluturim.';
$_MODULE['<{performancepro}prestashop>imageoptimizationform_7ac93db2d13cb6a0e02dfdeb85c13671'] = 'Në përgjithësi, të gjitha imazhet do të konvertohen nëse veçoritë e modulit janë të aktivizuara. Megjithatë, nëse një imazh thirret nga jashtë etiketës së imazhit ose nëse imazhi ngarkohet në DOM pas ngarkimit të faqes, imazhi do të qëndrojë në formën e tij origjinale.';
$_MODULE['<{performancepro}prestashop>imageoptimizationform_c59b4222398ea95f7545632a43d2d068'] = 'Konverto imazhet JPEG në WebP';
$_MODULE['<{performancepro}prestashop>imageoptimizationform_e1d260a53bf19d9ee165b35689a5deeb'] = 'Konverto JPEG në WebP. WebP është një format i gjeneratës së ardhshme që mbështet cilësinë e kompresimit pa humbje dhe humbje për imazhet në internet. Kompania Google e zhvilloi këtë format posaçërisht për të kryer punë në internet sa më shpejt dhe me lehtësi. Avantazhi kryesor është se madhësia e skedarit është e vogël në krahasim me formatet e tjera të imazhit, por e ngjashme në cilësi. %s.';
